import React, { Component } from 'react';

import Adirasa from "../assets/Adirasa.png";

class CarouselProduct extends Component {
  render () {
    return (
      <img top width="100%" src={Adirasa} alt="Not found" top="true"/>
    )
  }
}


export default CarouselProduct;
